import Vue from 'vue';
import VueRouter from 'vue-router';
Vue.use(VueRouter);
const router =new VueRouter({
  mode:"history",
  routes:[
    {path:"/",component:require('./components/Home.vue').default},
    { path: '/users', component: require('./components/Users.vue').default },
    
    { path: '/roles', component: require('./components/roles/Index.vue').default },
    { path: '/roles/create', component: require('./components/roles/Add.vue').default },
    { path: '/roles/:id/edit', component: require('./components/roles/Add.vue').default },
   
    
    { path: '/permissions', component: require('./components/permissions/Index.vue').default },
    { path: '/permissions/create', component: require('./components/permissions/Add.vue').default },
    { path: '/permissions/:id/edit', component: require('./components/permissions/Add.vue').default },
    
    { path: '/categories', component: require('./components/categories/Index.vue').default },
    { path: '/categories/create', component: require('./components/categories/Add.vue').default },
    { path: '/categories/:id/edit', component: require('./components/categories/Add.vue').default },
    
    
    { path: '/posts', component: require('./components/posts/Index.vue').default },
    { path: '/posts/create', component: require('./components/posts/Add.vue').default },
    { path: '/posts/:id/edit', component: require('./components/posts/Add.vue').default },
    

    { path: '*', component: require('./components/Home.vue').default },
  ],
  
});
